import { useState } from "react"
import "./ColorBox.css";

export default function ColorBox() {
    const [ color, setColor ] = useState("FFD9ED")

    const pastelColors = [
        "#FFDFD9",
        "#E6FFD9",
        "#E8D9FF",
        "#FFEBD9",
        "#D9FFFC",
        "#FFF5D9",
        "#D9FFE5",
        "FFD9ED",
        "#E0FFD9",
        "#D9F2FF",
    ]

    const changeColor = () => setColor = color[Math.random(pastelColors.lenght)]
    console.log(color)

    return (
        <div onClick={changeColor} style={changeColor} className="box"></div>
    )
}
